            .then(x =>
                console.log(x)
                ).catch(e =>
                    this.setState({
                        personen: [],
            }))
    }

    async componentDidMount() {
        fetch("http://localhost:5500/zeit/personen")
        .then(res => res.json())
        .then(x => console.log(x))
        .then(result => {
            this.setState({
                personen: result.items
            });
        })

    }



    render() {
        const { items } = this.state;
